// ==UserScript==
// @version 1
// @name Say No to Facebook
// @author  redpraveen
// @namespace
// @description Redirects to a different facebook page
// @include *facebook.com*
// ==/UserScript==



if(window.location.href == "http://www.facebook.com/nofacebook"){
	document.getElementsByTagName('body')[0].innerHTML = '<img alt="No Facebook" width="451" height="294"'+ 
  	'src="'+
  	'data:image/jpeg;base64,%3D%3D'+
  	'" />';
  	document.title = "No Facebook";
}else{
	window.location.href="http://www.facebook.com/nofacebook";
}